import { useEffect, useState } from "react";

function Seat() {
  const [reviewList, setReviewList] = useState([]);
  const getReviewList = async () => {
    const a = await fetch("/api/seat/1");
    const b = await a.json();
    setReviewList(b);
  };

  useEffect(() => {
    getReviewList();
  }, []);

  return <>{reviewList.forEach((e) => {})}</>;
}

export default Seat;
